import React from 'react';
import images from "./imgs.js";
import Card from "./Card.jsx";


function createcard(props)
{
  return(
    <div>

      <img className="pic" scr={props.val} alt="pic_img"/>
    </div>
  );
}

function App() {
  return (
    <div >
      {images.map(createcard)}
    </div>
  );
}

export default App;
